import React, { Component } from 'react';
import {  Button,Input,Icon,Card } from 'antd';

import logo from './assets/logo.png';
import './App.css';

class FeeSchedules extends Component {
    constructor(props){
      super(props);
    }
    render() {
      return (
        <div className="App">
          <center>
          <Card title="NSS Event" bordered={true} style={{ width: 300 }}>
            <p>Swacch Bharat 5k Run</p>
            <p>Starting from CreekSide</p>
            <p>On Sunday 29th October 8AM</p>
        </Card>
          </center>

        </div>
      );
    }
  }

  export default FeeSchedules;
